import styled from 'styled-components';

const StyledInnerTimer = styled.div`
  text-align: center;
  font-family: 'Roboto Mono', monospace;
  font-size: 35px;
  margin: 10px 0;
  display: inline-block;
  width: 200px;
`;

const InnerTimer = ({ value, disabledValue, onChange, label }) => {

  return (
      <StyledInnerTimer></StyledInnerTimer>
  );
};

  export default InnerTimer;
